import React from "react";
import { PokemonInput } from "./Style";

const AddPokemonField = (
    setPokemonName,
    pokemonName
) => {
    <Container>
        <PokemonInput
            placeholder='Choose starter pokemon'
            onChange={(e) => setPokemonName(e.target.value)}
            value={pokemonName}
        />
    </Container>
}

export default AddPokemonField;
